import "./style.css";
import Post from './records.json';

const Data = Post;

function DataFetching() {
    console.log("heelo");
    console.log(DataFetching);
    <div className="post">
        <h2>
        <ul>
        
            {Data.map(post => (
                <li key={post.id}>
                    <h3>Hi {post.title}</h3>
                    <p>{post.body}</p>
                </li>
            ))}

        </ul>
        </h2>
    </div>
}
export default DataFetching
